import './ExpensesList.css';

function ExpensesList(props) {
	const labelCar = <h2 className="label">Sultan's cars:</h2>;

	let expenseContent = <p>Нет приобретенных машин</p>;

	if (filteredExpenses.length > 0) {
		expenseContent = filteredExpenses.map((expenses) => {
			expenses.date.getFullYear();
			return (
				<ExpenseItem
					key={expenses.id}
					title={expenses.title}
					amount={expenses.amount}
					date={expenses.date}
				/>
			);
		});
	}

	if (filteredYear.length > 4) {
		expenseContent = props.items.map((cars) => {
			return (
				<ExpenseItem
					key={cars.id}
					title={cars.title}
					amount={cars.amount}
					date={cars.date}
				/>
			);
		});
	}
}

export default ExpensesList;
